import React, { useState, useEffect } from 'react';

const SupportPages = () => {
  const [currentView, setCurrentView] = useState('settings');
  const [isDesktop, setIsDesktop] = useState(window.innerWidth >= 1024);
  const [searchQuery, setSearchQuery] = useState('');
  const [issueDescription, setIssueDescription] = useState('');

  useEffect(() => {
    const handleResize = () => {
      setIsDesktop(window.innerWidth >= 1024);
    };
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const settingsCategories = [
    { icon: 'üë§', label: 'Profile Picture' },
    { icon: '‚ÑπÔ∏è', label: 'Personal Information' },
    { icon: 'üîÑ', label: 'Data Sharing Preferences' },
    { icon: 'üîí', label: 'Security and Privacy' },
    { icon: 'üîî', label: 'Notifications' },
    { icon: 'üë•', label: 'Members' },
    { icon: '‚ôø', label: 'Accessibility' },
    { icon: 'üí¨', label: 'Support' },
    { icon: 'üè†', label: 'Household' },
    { icon: 'üìä', label: 'Dashboard' }
  ];

  return (
    <div className={`app-container ${isDesktop ? 'desktop' : 'mobile'}`}>
      <style>{`
        .app-container {
          min-height: 100vh;
          background: #ffffff;
          display: flex;
          justify-content: center;
          padding: 20px;
        }

        .page-container {
          background: white;
          border-radius: 20px;
          width: 100%;
          max-width: 480px;
          overflow: hidden;
          min-height: 100vh;
          box-shadow: 0 4px 10px rgba(0, 0, 0, 0.1);
        }

        .gradient-header {
          padding: 25px;
          color: white;
          text-align: center;
          font-size: 22px;
          font-weight: bold;
          background: linear-gradient(to right, #a18cd1, #fbc2eb);
          border-bottom-left-radius: 20px;
          border-bottom-right-radius: 20px;
        }

        .profile-section {
          display: flex;
          align-items: center;
          padding: 20px;
          flex-direction: column;
          text-align: center;
          border-bottom: 1px solid #eee;
        }

        .avatar {
          width: 70px;
          height: 70px;
          background: #e0e0e0;
          border-radius: 50%;
        }

        .user-info {
          margin-top: 10px;
        }

        .user-info h2 {
          margin: 5px 0 2px;
          font-size: 18px;
          color: #333;
          font-weight: bold;
        }

        .settings-sections {
          padding: 20px;
        }

        .settings-list {
          display: flex;
          flex-direction: column;
          gap: 10px;
        }

        .settings-item {
          display: flex;
          align-items: center;
          justify-content: space-between;
          background: #fff;
          padding: 15px;
          border-radius: 10px;
          border: 1px solid #eee;
          cursor: pointer;
          transition: all 0.3s;
          font-size: 14px;
          font-weight: 500;
        }

        .settings-item:hover {
          background: #f0f0f0;
        }

        .arrow {
          font-size: 18px;
          color: #bbb;
        }

        .bottom-nav {
          position: fixed;
          bottom: 0;
          left: 0;
          right: 0;
          background: white;
          display: flex;
          justify-content: space-around;
          padding: 10px 0;
          border-top: 1px solid #eee;
        }

        .nav-item {
          display: flex;
          flex-direction: column;
          align-items: center;
          font-size: 12px;
          color: #999;
          cursor: pointer;
        }

        .nav-item.active {
          color: #ff60a8;
        }
      `}</style>
      <div className="page-container">
        <header className="gradient-header settings">
          <h1>Settings</h1>
        </header>
        <div className="profile-section">
          <div className="avatar"></div>
          <div className="user-info">
            <h2>Username</h2>
            <p>Personal Information</p>
            <span className="role-container">Household Manager</span>
          </div>
        </div>
        <div className="settings-sections">
          <section>
            <h3 className="section-title">Profile</h3>
            <div className="settings-list">
              {settingsCategories.slice(0, 3).map((item, index) => (
                <button key={index} className="settings-item">
                  <span>{item.icon}</span>
                  <span>{item.label}</span>
                  <span className="arrow">‚Ä∫</span>
                </button>
              ))}
            </div>
          </section>
          <section>
            <h3 className="section-title">Account and App</h3>
            <div className="settings-list">
              {settingsCategories.slice(3).map((item, index) => (
                <button key={index} className="settings-item">
                  <span>{item.icon}</span>
                  <span>{item.label}</span>
                  <span className="arrow">‚Ä∫</span>
                </button>
              ))}
            </div>
          </section>
        </div>
      </div>
    </div>
  );
};

export default SupportPages;
